import React, { Component } from "react";
import "./Navbar.css";

class ImageTable extends Component {
  render() {
    return (
      <div class="container">
        <div class="row">
          <div class="col-sm">One of three columns</div>
          <div class="col-sm">One of three columns</div>
          <div class="col-sm">One of three columns</div>
        </div>
      </div>
    );
  }
}

export default ImageTable;
